using System;
using System.IO;
using MelonLoader;
using neeko.Config;
using neeko.Wrappers;
using ReMod.Core.Managers;
using UnityEngine;

namespace neeko.ResourceManager
{
    internal class Resources
    {
        private static Sprite LoadSprite(string sprite)
        {
            return (Resources.resourcePath + "/resources/" + sprite).LoadSpritFromDisk();
        }
        private static void isIconUpdateNeeded()
        {
            if (ConfManager.iconsVersion.Value == 3)
            {
                return;
            }
            Resources.needOfUpdate = true;
            ConfManager.iconsVersion.Value = 3;
            MelonPreferences.Save();
        }
        internal static void InitResources()
        {
            NeekoLog.Msg("Initializing resources...", "Ini", ConsoleColor.Green);
            if (!Directory.Exists(Resources.resourcePath + "/resources"))
            {
                Directory.CreateDirectory(Resources.resourcePath + "/resources");
            }
            //Resources.isIconUpdateNeeded();
            Resources.download();
            Resources.LoadResources();
        }
        private static void LoadResources()
        {
            Resources.uwuclaraIcon = Resources.LoadSprite("uwuclara");
            Resources.uwuclaraBackGroundIcon = Resources.LoadSprite("uwuclaraBackGround");
            Resources.userHacksIcon = Resources.LoadSprite("userHacks");
            Resources.worldHacksIcon = Resources.LoadSprite("worldHacks");
            Resources.networkHacksIcon = Resources.LoadSprite("networkHacks");
            Resources.gameHacksIcon = Resources.LoadSprite("gameHacks");
            Resources.gameMurder4Icon = Resources.LoadSprite("gameMurder4");
            Resources.gameJustBClubIcon = Resources.LoadSprite("gameJustBClub");
            Resources.gameAmongASSIcon = Resources.LoadSprite("gameAmongASS");
            Resources.sitOnIcon = Resources.LoadSprite("sitOn");
            Resources.itemManipulatorIcon = Resources.LoadSprite("itemManipulator");
            Resources.lastSeenAvisIcon = Resources.LoadSprite("lastSeenAvis");
            Resources.instanceHistoryIcon = Resources.LoadSprite("instanceHistory");
        }
        private static void download()
        {
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/uwuclara"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/uwuclara", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/uwuclaraBackGround"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/uwuclaraBackGround", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/userHacks"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/userHacks", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/worldHacks"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/worldHacks", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/networkHacks"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/networkHacks", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/gameHacks"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/gameHacks", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/gameMurder4"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/gameMurder4", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/gameJustBClub"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/gameJustBClub", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/gameAmongASS"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/gameAmongASS", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/sitOn"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/sitOn", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/itemManipulator"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/itemManipulator", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/lastSeenAvis"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/lastSeenAvis", Convert.FromBase64String(""));
            }
            if (Resources.needOfUpdate || !File.Exists(Resources.resourcePath + "/resources/instanceHistory"))
            {
                File.WriteAllBytes(Resources.resourcePath + "/resources/instanceHistory", Convert.FromBase64String(""));
            }
        }
        private const int iconsCurrentVersion = 3;
        internal static Sprite uwuclaraIcon;
        internal static Sprite uwuclaraBackGroundIcon;
        internal static Sprite userHacksIcon;
        internal static Sprite worldHacksIcon;
        internal static Sprite networkHacksIcon;
        internal static Sprite gameHacksIcon;
        internal static Sprite gameMurder4Icon;
        internal static Sprite gameJustBClubIcon;
        internal static Sprite gameAmongASSIcon;
        internal static Sprite sitOnIcon;
        internal static Sprite itemManipulatorIcon;
        internal static Sprite lastSeenAvisIcon;
        internal static Sprite instanceHistoryIcon;
        private static bool needOfUpdate;
        private static readonly string resourcePath = ConfManager.getResourcePathFull();
    }
}
